import './App.css';
import Header from './components/Header';
import List from './components/List';
// import Table from './Table';

function App() {
  return (
    <>
    <div className="App">
      <h2>Bismillah</h2>
      {/* <Table/> */}
      <Header title='Fullstack'  id='2' />

      const List = ['shabir','abul','musthafa','siddiq']
      <List name ={List} />
    </div>
    </>
  );
}

export default App;
